export const notNull = form => {
    let errors = [];
    if(form.nmFantazy === ''){
        errors.push('Nome fantazia deve ser preenchido.');     
    }
    if(form.cnpj === ''){
        errors.push('Documento deve ser preenchido.');     
    }
    if(form.zip === ''){
        errors.push('Cep deve ser preenchido.');     
    }
    if(form.street === ''){
        errors.push('Nome da rua deve ser preenchido.');     
    }
    if(form.number === ''){
        errors.push('Número deve ser preenchido.');     
    }
    if(form.neighborhood === ''){
        errors.push('Bairro deve ser preenchido.');     
    }
    if(form.city === ''){
        errors.push('Cidade deve ser preenchido.');     
    }
    if(form.state === ''){
        errors.push('Estado deve ser preenchido.');     
    }
    return errors;
}
